const Landing = () => {
  return (
    <div className="container">
      {/* <div className="jumbotron mt-5"> */}
      {/* <div className="col-sm-8 mx-auto"> */}
      <h1 className="text-center">WELCOME To Equip9</h1>

      {/* Carousel Start */}
      <Carousel className="jumbotron mt-10 col-sm-8 mx-auto">
        <Carousel.Item>
          <img
            className="d-block w-100"
            src={home_carousel_One}
            alt="First slide"
          />
          <Carousel.Caption>
            <h3>First slide label</h3>
